      <main className='container mx-auto'>
        <Routes>
          <Route path='/' element={<Home />} />
          <Route path='/Products/*' element={<Products />} />
          <Route path='/Post' element={<Post />} />
        </Routes>
      </main>
    </>
  );
};

export default App;
